static inline
void insert_sample_s(int16_t in_val,int16_t* delay_line,int32_t len)
{
#if USE_NEON
    int i = len-8;
    int16x8_t vec_x1;
    int16x8_t vec_x2;

    vec_x1 = vld1q_s16(&delay_line[i]);     // load last 8 samples
    vst1q_s16(&delay_line[i+1], vec_x1);    // store 8 samples with offset of one
    while (i > 0) {
        i = i - 8;
        vec_x2 = vld1q_s16(&delay_line[i]); // load 8 samples
        vst1q_s16(&delay_line[i+1], vec_x2);// store 8 samples
    }
    delay_line[0] = in_val;
#else
    // Copy inputs to the right
    for (i=len-1 ; i>0 ; i--) {
        delay_line[i] = delay_line[i-1];
    }
    delay_line[0] = in_val;
#endif
}

static inline
int32_t mpy3216(int32_t x32, int32_t x16)
{
#if USE_INLINE_ASSEMBLY
    int32_t out;

    asm( "smulwb %[out], %[x32], %[x16] \n"
    : [out]"=r"(out)
    : [x32]"r"(x32), [x16]"r"(x16)
    : );
    return out;
#else
    long long y;
    y = (long long) x16 * x32;
    return(y >> 15);
#endif
}

static inline
int32_t dot_product_q15(int16_t* u, int16_t* v, int len)
{
#if USE_NEON
    int i;
    int32_t out;
    int32x4_t qAccumulator;

    qAccumulator = vdupq_n_s32(0); // initialize all elements to 0
    while (len > 0) {
        int16x4_t dVect1, dVect2;  // 16x4 data vectors

        dVect1 = vld1_s16(u);      // load Q15 data
        dVect2 = vld1_s16(v);      // load Q15 data

        // Multiply 16-bit lanes in dVect1 with corresponding lanes in dVect2
        // Add resulting products to 32-bit lanes in accumulator vector
        qAccumulator = vmlal_s16(qAccumulator, dVect1, dVect2);
        // Update pointers and loop/size counter
        u += 4;
        v += 4;
        len -= 4;
    }
    // Accumulate the lanes in the accumulation vector qAccumulator into an
    // int32_t return value
    int32x2_t dAccL, dAccH;

    // Split 128-bit qAccumulator into 64-bit dAccL and dAccH for accumulation
    dAccL = vget_low_s32(qAccumulator);
    dAccH = vget_high_s32(qAccumulator);

    // Accumulate 2 lanes in dAccL and dAccH into 2 lanes in dAccL
    dAccL = vadd_s32(dAccL, dAccH);
    // Accumulate 2 lanes in dAccL into first (and second) lane of dAccL
    dAccL = vpadd_s32(dAccL, dAccL);

    // Add accumulated value to retval
    out = vget_lane_s32(dAccL, 0); // Q.30
    return out >> 15; // This seems to be the proper number to shift to avoid
                      // distortion at full volume (determined experimentally)
#elif USE_INLINE_ASSEMBLY
    int i;
    int32_t out;
    union {
        int64_t ll;
        struct
        {
            int32_t l;
            int32_t h;
        } s;
    } sum;

    sum.ll = 0;
    for(i=0 ; i<len ; i++) {
        int32_t x = (int32_t) u[i];
        int32_t h = (int32_t) v[i];
        // multiply and accumulate into a long long
       asm( "smlalbb %[sum_lo], %[sum_hi], %[h], %[x] \n"
        : [sum_lo]"+r"(sum.s.l), [sum_hi]"+r"(sum.s.h)
        : [h]"r"(h), [x]"r"(x)
        : );
    }
    return (int32_t) (sum.ll >> 16) ;
#else
    int i;
    int32_t out;
    union {
        int64_t ll;
        struct
        {
            int32_t l;
            int32_t h;
        }s;
    } sum;

    sum.ll = 0;
    for(i=0 ; i<len ; i++) {
        sum.ll = sum.ll + (((int) v[i]*u[i]) << 1);
    }
    return (int32_t) (sum.ll >> 16) ;
#endif
}

void AudioResamplerBeats::initBeatsState(resamp_state *rs)
{
    rs->delayline_int16 = (int16_t*) memalign(32, sizeof(int16_t) * (mPpfiltLen+1));
    // Adding extra space at the end so that delay-line copy
    // does not have extra logic to handle boundary
    memset(rs->delayline_int16, 0, sizeof(int16_t)*(mPpfiltLen+1));
}

AudioResamplerBeats::AudioResamplerBeats(int bitDepth,
        int inChannelCount, int32_t sampleRate, src_quality quality)
    : AudioResampler(bitDepth, inChannelCount, sampleRate, quality),
        H_LOW_QUALITY_44_TO_48_INT16_LEN(2560),
        H_MED_QUALITY_44_TO_48_INT16_LEN(2560),
        H_HIGH_QUALITY_44_TO_48_INT16_LEN(3840),
        H_VERY_HIGH_QUALITY_44_TO_48_INT16_LEN(5120),
        H_LOW_QUALITY_48_TO_44_INT16_LEN(2352),
        H_MED_QUALITY_48_TO_44_INT16_LEN(2352),
        H_HIGH_QUALITY_48_TO_44_INT16_LEN(3528),
        H_VERY_HIGH_QUALITY_48_TO_44_INT16_LEN(4704)
{
    ALOGV("AudioResamplerBeats Constructor: entered");
    // AudioResamplerBeats only gets called if Fsin and Fsout = 44100 or 48000
    if (sampleRate != 44100 && sampleRate != 48000) {
        ALOGE("Unsupported sample rate %d Hz", sampleRate);
    }

    if (sampleRate == 48000) {
        mUpFactor = 160;
        mDnFactor = 147;
        switch (quality) {
        case LOW_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_LOW_QUALITY_44_to_48_int16[0][0];
            mPpfiltLen = H_LOW_QUALITY_44_TO_48_INT16_LEN / mUpFactor;
            ALOGV("LOW_QUALITY, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        case MED_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_MED_QUALITY_44_to_48_int16[0][0];
            mPpfiltLen= H_MED_QUALITY_44_TO_48_INT16_LEN / mUpFactor;
            ALOGV("MED_QUALITY, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        case HIGH_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_HIGH_QUALITY_44_to_48_int16[0][0];
            mPpfiltLen= H_HIGH_QUALITY_44_TO_48_INT16_LEN / mUpFactor;
            ALOGV("HIGH_QUALITY, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        case VERY_HIGH_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_VERY_HIGH_QUALITY_44_to_48_int16[0][0];
            mPpfiltLen= H_VERY_HIGH_QUALITY_44_TO_48_INT16_LEN / mUpFactor;
            ALOGV("VERY_HIGH_QUALITY, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        default:
            mppFilterTaps_int16 = (const int16_t**) &h_LOW_QUALITY_44_to_48_int16[0][0];
            mPpfiltLen= H_LOW_QUALITY_44_TO_48_INT16_LEN / mUpFactor;
            ALOGV("LOW_QUALITY, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        }
    }
    else {
        mUpFactor = 147;
        mDnFactor = 160;
        switch (quality) {
        case LOW_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_LOW_QUALITY_48_to_44_int16[0][0];
            mPpfiltLen= H_LOW_QUALITY_48_TO_44_INT16_LEN / mUpFactor;
            ALOGV("LOW_QUALITY_48_TO_44, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        case MED_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_MED_QUALITY_48_to_44_int16[0][0];
            mPpfiltLen= H_MED_QUALITY_48_TO_44_INT16_LEN / mUpFactor;
            ALOGV("MED_QUALITY_48_TO_44, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        case HIGH_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_HIGH_QUALITY_48_to_44_int16[0][0];
            mPpfiltLen= H_HIGH_QUALITY_48_TO_44_INT16_LEN / mUpFactor;
            ALOGV("HIGH_QUALITY_48_TO_44, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        case VERY_HIGH_QUALITY:
            mppFilterTaps_int16 = (const int16_t**) &h_VERY_HIGH_QUALITY_48_to_44_int16[0][0];
            mPpfiltLen= H_VERY_HIGH_QUALITY_48_TO_44_INT16_LEN / mUpFactor;
            ALOGV("VERY_HIGH_QUALITY_48_TO_44, FilterTaps_ptr = %d, ppfilt_len =%d",
                    mppFilterTaps_int16,mPpfiltLen);
            break;
        default:
            mppFilterTaps_int16 = (const int16_t**) &h_LOW_QUALITY_48_to_44_int16[0][0];
            mPpfiltLen= H_LOW_QUALITY_48_TO_44_INT16_LEN / mUpFactor;
            break;
        }
    }
    mPpState = 0;
    initBeatsState(&left);
    initBeatsState(&right);
    ALOGV("AudioResamplerBeats Constructor: upfactor = %d, dnfactor = %d exit",mUpFactor,mDnFactor);
}

AudioResamplerBeats::~AudioResamplerBeats()
{
    free(left.delayline_int16);
    free(right.delayline_int16);
    ALOGV("AudioResamplerBeats::~AudioResamplerBeats");
}
#if BEATS_PROFILING
static timespec diff(timespec start, timespec end)
{
    timespec temp;
    if ((end.tv_nsec-start.tv_nsec)<0) {
        temp.tv_sec = end.tv_sec-start.tv_sec-1;
        temp.tv_nsec = 1000000000+end.tv_nsec-start.tv_nsec;
    }
    else {
        temp.tv_sec = end.tv_sec-start.tv_sec;
        temp.tv_nsec = end.tv_nsec-start.tv_nsec;
    }
    return temp;
}
#endif

void AudioResamplerBeats::resample(int32_t* out, size_t outFrameCount,
        AudioBufferProvider* provider)
{
#if BEATS_PROFILING
    timespec time1,time2;
    ThreadCpuUsage tcu; // for reading the current CPU clock frequency in kHz

    // get the absolute value of CPU clock frequency in kHz
    int cpuNum = sched_getcpu();
    uint32_t kHz = tcu.getCpukHz(cpuNum);
    clock_gettime(CLOCK_THREAD_CPUTIME_ID,&time1);
#endif
    // select the appropriate resampler
    switch (mChannelCount) {
    case 1:
        //ALOGV("resample calling resampleMono16");
        resampleMono16(out, outFrameCount, provider);
        break;
    case 2:
        //ALOGV("resample calling resampleStereo16");
        resampleStereo16(out, outFrameCount, provider);
        break;
    }
#if BEATS_PROFILING
    clock_gettime(CLOCK_THREAD_CPUTIME_ID,&time2);
    ALOGV("Time taken: %d : %d Clock: %d Beats Resampler",diff(time1,time2).tv_sec,
            diff(time1,time2).tv_nsec,kHz);
#endif
}

void AudioResamplerBeats::resampleMono16(int32_t* out, size_t outFrameCount,
        AudioBufferProvider* provider)
{
    int32_t vl = mVolume[0];
    int32_t vr = mVolume[1];

    size_t inputIndex = mInputIndex;
    size_t outputIndex = 0;
    size_t outputSampleCount = outFrameCount * 2;
    size_t inFrameCount = (outFrameCount*mInSampleRate)/mSampleRate;

    int32_t ind = mPpState + mUpFactor;
    // fetch first buffer
    if (mBuffer.frameCount == 0) {
        mBuffer.frameCount = inFrameCount;
        provider->getNextBuffer(&mBuffer, mPTS);
        if (mBuffer.raw == NULL)
            return;
    }
    int16_t *in = mBuffer.i16;

    while (outputIndex < outputSampleCount) {
        int32_t sample;
        if (inputIndex == mBuffer.frameCount) {
            inputIndex = 0;
            provider->releaseBuffer(&mBuffer);
            mBuffer.frameCount = inFrameCount;
            provider->getNextBuffer(&mBuffer,
            calculateOutputPTS(outputIndex / 2));
            if (mBuffer.raw == NULL)
                goto save_state;  // ugly, but efficient

            in = mBuffer.i16;
        }
        ind = ind - mUpFactor;
        // shift delay line and shift in the input
        insert_sample_s(in[inputIndex],left.delayline_int16,mPpfiltLen);
        while (ind < mUpFactor) {
            sample = dot_product_q15(left.delayline_int16,(int16_t*)mppFilterTaps_int16 +
                    ind*mPpfiltLen,mPpfiltLen);
            out[outputIndex++] += vl * sample;
            out[outputIndex++] += vr * sample;
            ind = ind + mDnFactor;
        }
        inputIndex++;
    }

    save_state:
    mPpState = ind % mUpFactor;
    mInputIndex = inputIndex;
    ALOGV("Done: Input index=%zu, ppstate=%d, outputIndex = %zu", inputIndex, mPpState,outputIndex);
}


void AudioResamplerBeats::resampleStereo16(int32_t* out, size_t outFrameCount,
        AudioBufferProvider* provider)
{
    int32_t vl = mVolume[0];
    int32_t vr = mVolume[1];

    size_t inputIndex = mInputIndex;
    size_t outputIndex = 0;
    size_t outputSampleCount = outFrameCount * 2;
    size_t inFrameCount = (outFrameCount*mInSampleRate)/mSampleRate;

    int32_t ind = mPpState + mUpFactor;
    ALOGV("resampleStereo16 inputIndex = %d inframeCount = %d mBuffer.frameCount = %d"
            "outputIndex = %d",inputIndex, inFrameCount, mBuffer.frameCount,outputIndex);
    // fetch first buffer
    if (mBuffer.frameCount == 0) {
        mBuffer.frameCount = inFrameCount;
        provider->getNextBuffer(&mBuffer,mPTS);
        if (mBuffer.raw == NULL)
            return;
    }
    int16_t *in = mBuffer.i16;

    while (outputIndex < outputSampleCount) {
        int32_t sample;
        if (inputIndex == mBuffer.frameCount) {
            inputIndex = 0;
            provider->releaseBuffer(&mBuffer);
            mBuffer.frameCount = inFrameCount;
            provider->getNextBuffer(&mBuffer,
            calculateOutputPTS(outputIndex / 2));
            if (mBuffer.raw == NULL)
                goto save_state;  // ugly, but efficient
            // ALOGW("New buffer: offset=%p, frames=%dn", mBuffer.raw, mBuffer.frameCount);
            // ALOGV("New buffer: offset=%p, outputIndex=%zu, mPTS = %zu", mBuffer.raw, outputIndex,
                    //mPTS);
            in = mBuffer.i16;
        }
        // Polyphase filter code -------------------- start
        ind = ind - mUpFactor;
        // shift delay line and shift in the input
        insert_sample_s(in[2*inputIndex],(int16_t*) left.delayline_int16,mPpfiltLen);
        insert_sample_s(in[2*inputIndex+1],(int16_t*) right.delayline_int16,mPpfiltLen);
        while (ind < mUpFactor) {
            sample = dot_product_q15((int16_t*) left.delayline_int16,(int16_t*)mppFilterTaps_int16 +
                     ind*mPpfiltLen, mPpfiltLen);
            out[outputIndex++] += vl * sample;

            sample = dot_product_q15((int16_t*) right.delayline_int16,(int16_t*)mppFilterTaps_int16+
                     ind*mPpfiltLen, mPpfiltLen);
            out[outputIndex++] += vr * sample;
            ind = ind + mDnFactor;
        }
        inputIndex++;
        // Polyphase filter code -------------------- end
    }

    save_state:
    ALOGV("save_state: index=%zu, mBuffer.frameCount = %d, outputIndex = %d", inputIndex,
            mBuffer.frameCount,outputIndex);
    mPpState = ind % mUpFactor;
    mInputIndex = inputIndex;

    }

